import ListBooks from './ListBooks';
import * as BooksAPI from './BooksAPI';
//import {Route} from 'react-router-dom';
import './App.css';



class App extends Component{

   bookshelves = [
      {key: 'current', name:'Currently Reading'},
      {key: 'future', name: 'Want to Read'},
      {key: 'done', name: 'Already Read'},
   ];

   state = {
      myBookList: []
   }

   componentDidMount(){
      BooksAPI.getAll().then((myBookList) => {
         this.setState(() => ({myBookList})
         )
         console.log({myBookList});
      })
    
   }

   render(){
      console.log(this.myBookList);
      return(
         <div className="app">
            <ListBooks bookshelves={this.bookshelves}/>
         </div>
      );
   }
}

export default App;
